Category	Feature, Sweet Sinner's My Daughter's Boyfriend Series

Director	James Avalon
Starring	India Summer, Mr Pete, Evan Stone, Adriana Chechik, Lola Foxx, Chad Alva

When she catches her boyfriend staring at her mother, Devon gets extremely jealous and breaks off the relationship. Her mother, however, talks her into getting back with the handsome young man, but her intensions may not be so innocent. The mother has a more conniving, erotic agenda in mind as she cleverly redirects the boy's sexual attention from her daughter to herself. Starring India Summer as the devious mother, the charming Lola Foxx as the daughter and Chad Alva as her boyfriend. Also featuring Adrianna Chechik, Mr. Pete and Evan Stone!


